import React from 'react'
import typeMenu from '../constants'

const TypeSelector = props => {
    const {setType} = props
    return <Grid container>
        {typeMenu.map((item) => {
            return <Grid item xs={4} md={12} onClick={() => setType(item.name)}>
                {item.title}
            </Grid>
        })}
    </Grid>
}

export default TypeSelector
